// CardView.js
import React from "react";
import Card from "./Card";
import "./CardView.css";

function CardView(props) {
  return (
    <div className="card-view">
      {props.cards.map((card) => (
        <Card key={card.id} title1={card[5][1]} title2={card[6][2]} />
      ))}
    </div>
  );
}

export default CardView;
